import React from "react";
import { Container } from "react-bootstrap";

const Header = ({ pageName, bc1, bc2, bc3, bclink1, bclink2, bclink3 }) => {
  return (
    <>
      <div style={{ backgroundColor: "#F5F5F5", height: 300 }}>
        <Container style={{ paddingTop: 100 }}>
          <h1>{pageName}</h1>
          <div className="flex">
            <p>
              <a href={bclink1}>{bc1} </a>
              <a href={bclink2}>{bc2} </a>
              <a href={bclink3}>{bc3} </a>
            </p>
          </div>
        </Container>
      </div>
    </>
  );
};

export default Header;
